VALUES ('Фахитас с курицей и фасолью','Фахитас с курицей и фасолью',
        'В разогретом масле обжариваем нарезанный болгарский перец, добавляем нарезанное кубиками куриное филе, слегка обжариваем, солим, добавляем нарезанный перец чили и консервированную в соусе чили фасоль, закрываем крышкой и тушим до готовности в течение 10 минут. Подаем с лавашом и сметаной.',
        30,'',5,1,3);

VALUES ('Курица в сметанно-горчичном соусе','Курица в сметанно-горчичном соусе',
'1. Нарезаем курицу на кубики среднего размера.
2. Обжариваем ее на разогретой сковородке в подсолнечном масле.
Я, как правило обжариваю ее до появления золотистого цвета. На это уходит в среднем 10-15 минут. Не надо спешить и жарить на большом огне, пусть лучше она медленно приобретает золотистый цвет, зато лучше прогреется за это время
3. Когда курица обжарилась, добавляем муку.
Хорошенько перемешиваем курицу вместе с мукой, и жарим еще какое-то время, 2-3 минутки.
4. Добавляем кипяченную воду. Она должна быть только что вскипевшей.
Хорошо перемешиваем все содержимое нашей сковородки, чтобы мука растворилась в воде и не осталось комочков. Должен получиться белесоватый однородный соус.
5. Теперь добавляем сметану и хорошо все перемешиваем.
6. И наконец, изюминка моего рецепта - французская горчица. Ее еще иногда называют дижонской. Ее главная особенность - наличие горчичных зернышек. Ее вкус может быть от сладковатого, до очень острого. Я использую чаще всего французскую горчицу фирмы Heinz, потому что она очень ароматная и острая.
Добавляем такую горчицу к нашей курочке.
И хорошо все перемешиваем.
7. Накрываем крышкой и тушим до готовности курицы. Если в процессе тушения соус выпаривается и вам кажется, что его маловато, можно добавить немного сливок 10% жирности.
8. Готовую курицу лучше всего подавать с рисом или картофельным пюре',
        30,'',5,1,1);

